import React, { Component } from 'react';
import './Tecnologies.css';

export default class Tecnologies extends Component {
  render() {
    return (
      <div className="tecno">
        <div className="content-tecno">
          <h3 className="tecno-title">Tecnologies Frame</h3>
          <p>Esse trecho está em construção ... aguardando produção do Bakcend</p>
        </div>
      </div>
    )
  }
}
